import React from 'react';
import { Avatar, Box } from '@mui/material';

function SpellImages({ spells, version }) {
  return (
    <Box display="flex" gap={0.5}>
      {spells.map((spellName, index) => (
        <Avatar
          key={`spell-${spellName}-${index}`}
          src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/${spellName}.png`}
          alt={`Spell ${spellName}`}
          sx={{ width: 24, height: 24, mr: 0.5, borderRadius: '4px', bgcolor: '#2d3748' }}
          variant="rounded"
        />
      ))}
    </Box>
  );
}

export default SpellImages;
